  [],\n\t\"revision_timestamp\": \"2015-05-06T21:18:44.122775\",\n\t\"name\": \"surface-optimization-techniques-for-deployable-reflectors-project-f133e\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Under this and several other programs, CTD
  has developed TEMBO&lt;SUP&gt;REG&lt;/SUP&gt; deployable solid-surface reflectors
  (TEMBO&lt;SUP&gt;REG&lt;/SUP&gt; Reflectors) to provide future NASA and  Air Force
  missions and commercial communications satellites with large RF apertures that can
  operate at very high operational frequencies (Ka band and above). TEMBO&lt;SUP&gt;REG&lt;/SUP&gt;
  Reflectors incorporate non-tensioned graphite composite membranes that are formed
  using conventional construction techniques and stiffened using CTD's TEMBO&lt;SUP&gt;REG&lt;/SUP&gt;
  shape-memory composite panels to allow practical packaging and deployment without
  complex mechanisms.  The simplicity of the design provides a significant cost advantage
  when compared to existing deployable reflector technologies, (4-fold cost reduction
  over mesh antenna and 2-fold reduction in manufacturing time) and the continuous
  graphite surface enables high frequency antenna operations at Ka band and above.
  \ CTD can stow either a Cassegrainian (center-fed) or Gregorian (offset-fed) 5m
  TEMBO&lt;SUP&gt;REG&lt;/SUP&gt; Reflectors in a Falcon 1e launch vehicle. To moderate
  cost and fabrication time, the TEMBO&lt;SUP&gt;REG&lt;/SUP&gt; reflector is supported
  by a deployable backing structure.  In the proposed Phase II effort, CTD will further
  refine innovative backing structure developed in Phase I as well as to develop additional
  precision capability to enable both the high frequency (Ka band and above), large
  aperture (5 to 8 meters) performance required for near-term and future NASA programs.\",\n\t\"license_title\":
